import React from 'react';

import Item from './Item/Item';

import classes from './AutoSuggestion.module.css';

const AutoSuggestion = () => {

    let test = ["Test_1", "Test_1", "Test_1", "Test_1"];

    return (
        <div className={classes.AutoSuggestion}>
            <ul>
                <Item itemType="primary">Search near me</Item>
                <Item itemType="secondary">Item 1</Item>
                <Item itemType="secondary">Item 2</Item>
                <Item itemType="secondary">Item 3</Item>
                <Item itemType="secondary">Item 4</Item>
            </ul>
        </div>
    );

};

export default AutoSuggestion;
